import './App.css';
import Header from './Header';
import Recommended from './Recommended';
import Sidebar from './Sidebar';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <Router>
      <div className="App">
        <Header/>
      <Routes>
        <Route path='/' element={<Header/>}>
      </Route>
      </Routes>
      </div>
    </Router>

  );
}

export default App;
